import { Source } from "@/types/backend";
import { ColumnDef } from "@tanstack/react-table";
import Image from "next/image";

interface CellBankProps {
  bank: Source | "Cash";
}

const BANK_ICONS: Record<Source | "Cash", string> = {
  "Cash": "data:image/png;base64,",
  "Millennium": "data:image/png;base64,",
  "Edenred": "data:image/png;base64,",
};

export default function CellBank({ bank }: CellBankProps) {
  return <Image src={BANK_ICONS[bank]} alt={bank} width={20} height={20} />;
}

export function defineCellBank<T extends { bank: Source }>() {
  return {
    accessorKey: "bank",
    header: "Bank",
    cell: ({ row }) => <CellBank bank={row.original.bank} />
  } as ColumnDef<T>;
}
